import React from 'react';
import { CanvasContext } from '@bucky24/react-canvas';

const MyElement = (props) => {
    return <Canvas
    width={300}
    height={300}
>
    <Imaimgge
        src="https://www.google.com/images/branding/googlelogo/2x/googlelogo_color_272x92dp.png"
        x={40}
        y={50}
        width={50}
        height={50}
    />
</Canvas>
}

export default MyElement;
